import React from "react";

const NewRow = () => {
    return(
        <div>
            <div>
                <label>Item</label>
            </div>
            <div>
                <label>QTY</label>
            </div>
            <div>
                <label>Price/Rate</label>
            </div>
            <div>
                <label>Action</label>
            </div>
        </div>
    );
}

export default NewRow;
